export default makeStyles({
  productSection: {
    padding: '30px',
    marginTop:'90px',
    borderRadius: '20px',
    backdropFilter: 'brightness(0.5)'
  },
  imageHolder: {
    maxWidth: '100%'
  },
  image: {
    width: '350px',
    height: '4000px',
  }
});
